import React, { Component } from "react";

export class Dashboard extends Component {
  render() {
    if (this.props.userLogedIn === false) {
      return (
        <div>
          <h4>Please sign in or register!</h4>
        </div>
      );
    } else {
      return (
        <div>
          <h4>Welcome Back! {this.props.username}</h4>
        </div>
      );
    }
  }
}

export default Dashboard;
